import React, { useState, useEffect } from 'react';
import { Typography, Box, CircularProgress, Card, CardContent, Avatar } from '@mui/material';
import { useAuth } from '../../contexts/AuthContext';
import { authService } from '../../services/auth';
import { useNavigate } from 'react-router-dom';
import { homeStyles } from './homeStyles';

export default function Home() {
  const styles = homeStyles();
  const { user } = useAuth();
  const [userDetails, setUserDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    if (!user || !user._id) {
      navigate('/login');
      return;
    }
    const fetchUserDetails = async () => {
      try {
        const res = await authService.getUserDetails(user._id);
        if (res.data && res.data.user) {
          setUserDetails(res.data.user);
        }
      } catch (error) {
        console.error("Error fetching user details:", error);
      } finally {
        setLoading(false);
      }
    };
    fetchUserDetails();
  }, [user, navigate]);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
        <CircularProgress />
      </Box>
    );
  }

  if (!userDetails) {
    return (
      <Typography variant="h6" align="center" sx={{ mt: 4 }}>
        No user details available.
      </Typography>
    );
  }

  return (
    <Box>
      {/* Hero Section */}
      <Box sx={styles.heroImage} />

      <Box sx={{ p: 3, maxWidth: 800, mx: 'auto', mt: -8 }}>
        <Card elevation={4} sx={{ borderRadius: '16px', overflow: 'visible' }}>
          <CardContent>
            <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
              <Avatar 
                src={userDetails.profilePic || '/default-avatar.png'} 
                sx={{ width: 80, height: 80, mr: 2, border: '3px solid white' }}
              >
                {userDetails.username.charAt(0).toUpperCase()}
              </Avatar>
              <Typography variant="h4">
                Welcome, {userDetails.username}
              </Typography>
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle1" color="textSecondary">
                Bio
              </Typography>
              <Typography variant="body1">
                {userDetails.bio || 'No bio available'}
              </Typography>
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle1" color="textSecondary">
                Interests
              </Typography>
              <Typography variant="body1">
                {userDetails.interests && Array.isArray(userDetails.interests)
                  ? userDetails.interests.join(', ')
                  : userDetails.interests || 'Not specified'}
              </Typography>
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle1" color="textSecondary">
                Likes
              </Typography>
              <Typography variant="body1">
                {userDetails.likes && Array.isArray(userDetails.likes)
                  ? userDetails.likes.join(', ')
                  : userDetails.likes || 'Not specified'}
              </Typography>
            </Box>
            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle1" color="textSecondary">
                Dislikes
              </Typography>
              <Typography variant="body1">
                {userDetails.dislikes && Array.isArray(userDetails.dislikes)
                  ? userDetails.dislikes.join(', ')
                  : userDetails.dislikes || 'Not specified'}
              </Typography>
            </Box>
            <Box>
              <Typography variant="subtitle1" color="textSecondary">
                Preferences
              </Typography>
              <Typography variant="body1">
                Anonymous Chat: {userDetails.preferences?.anonymousChat ? "Yes" : "No"}, 
                Match Preference: {userDetails.preferences?.matchPreference || 'Not specified'}
              </Typography>
            </Box>
          </CardContent>
        </Card>
      </Box>
    </Box>
  );
}
